import React from "react";

function home(){
    return(
        <div className="home">
            <div className="intro">
             <div className="overlay">
                <div className="container">
                    <div class="row">
                        <div class="col-md-8 col-md-offset-2 intro-text">
                            <h1>Houses & Appartments</h1><br></br>
                            For Rentals.
                            <h2>Find your dream home here...!!</h2><br></br>

                        </div>
                    </div>
                </div>
             </div>
            </div>
        </div>
    );
}

 export default home;
